import axios from "axios"

const fetchImage = () => {

    return axios.get("https://pixabay.com/api/?key=19685928-f191ac91b9da632ea9a4b744f&q=yellow+flowers&image_type=photo&pretty=true")
        .then(res => res.data)

}

export default fetchImage;
